import React, { useEffect, useState } from 'react';
import { getAllEventsAdmin, approveRequest, rejectRequest } from '../services/events';

export default function AdminDashboard(){
  const [data,setData] = useState({events:[],requests:[]});
  const [loading,setLoading] = useState(false);

  const load = async ()=>{
    try{
      const r = await getAllEventsAdmin();
      setData(r.data);
    }catch(err){ console.error(err); }
  }

  useEffect(()=>{ load(); },[]);

  const onApprove = async (id) => {
    setLoading(true);
    try{ await approveRequest(id); await load(); }catch(e){console.error(e);} finally{setLoading(false)}
  }

  const onReject = async (id) => {
    setLoading(true);
    try{ await rejectRequest(id); await load(); }catch(e){console.error(e);} finally{setLoading(false)}
  }

  return (
    <div className="container mt-4">
      <h2>Admin Dashboard</h2>
      <div className="row mb-3">
        <div className="col-md-4"><div className="card p-3">Events: {data.events.length}</div></div>
        <div className="col-md-4"><div className="card p-3">Pending Requests: {data.requests.filter(x=>x.status==='Pending').length}</div></div>
      </div>

      <div className="admin-outlook card">
        <div className="outlook-header d-flex justify-content-between align-items-center p-2 border-bottom">
          <h5 className="mb-0">Event Requests</h5>
          <small className="text-muted">Inbox • {data.requests.length}</small>
        </div>
        <div className="outlook-list">
          {data.requests.map(r=> (
            <div key={r._id} className="outlook-item d-flex justify-content-between align-items-start p-3 border-bottom">
              <div>
                <div className="d-flex align-items-center">
                  <div className="sender-avatar bg-secondary text-white rounded-circle me-2">{(r.requestedBy?.name||'U').charAt(0)}</div>
                  <div>
                    <strong>{r.title}</strong>
                    <div className="text-muted small">{r.requestedBy?.name} • {new Date(r.createdAt).toLocaleString()}</div>
                  </div>
                </div>
                <div className="mt-2 text-truncate" style={{maxWidth:600}}>{r.description}</div>
                {r.timeline && r.timeline.length>0 && (
                  <ul className="mt-2 small">
                    {r.timeline.map((t,i)=>(<li key={i}><strong>{t.time}</strong> — {t.activity}</li>))}
                  </ul>
                )}
              </div>
              <div className="text-end">
                <div className="mb-2">
                  <button className="btn btn-success btn-sm me-2" onClick={()=>onApprove(r._id)} disabled={loading}>Approve</button>
                  <button className="btn btn-danger btn-sm" onClick={()=>onReject(r._id)} disabled={loading}>Reject</button>
                </div>
                <div className="small text-muted">{r.status}</div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  )
}
